import s from "./hero.module.css";
import heroimg from "../../images/svg/illustration-hero.svg";
export const Hero = () => {
  return (
    <div>
      <img className={s.imghero} src={heroimg} alt="hero"></img>
      <h1 className={s.title}>A Simple Bookmark Manager</h1>
      <p className={s.desc}>
        A clean and simple interface to organize your favourite websites. Open a
        new browser tab and see your sites load instantly. Try it for free.
      </p>
      <div>
        <button className={s.btn - chrome}>Get it on Chrome</button>
        <button className={s.btn - firefox}>Get it on Firefox</button>
      </div>
    </div>
  );
};
